def self.default(options = {})
  @default ||= new(options)
end

def start(info)
  Prompter.new(info)
end

def self.configuration_for(host, use_ssh_config)
  files = case use_ssh_config
          when true then Net::SSH::Config.expandable_default_files
          when false, nil then return {}
          else Array(use_ssh_config)
          end

  Net::SSH::Config.for(host, files)
end

def for(host, files=expandable_default_files)
  translate(files.inject({}) { |settings, file|
    load(file, host, settings)
  })
end

def self.extended(object)
  object.__send__(:initialize_ssh)
end

def key_length(*v)
  @key_length = nil if !defined?(@key_length)
  if v.empty?
    @key_length = superclass.key_length if @key_length.nil? && superclass.respond_to?(:key_length)
    return @key_length
  elsif v.length == 1
    @key_length = v.first
  else
    raise ArgumentError, "wrong number of arguments (#{v.length} for 1)"
  end
end

def key=(value)
  @key = value ? value.to_s[0,key_length] : nil
end

def etm(*v)
  @etm = false if !defined?(@etm)
  if v.empty?
    @etm = superclass.etm if @etm.nil? && superclass.respond_to?(:etm)
    return @etm
  elsif v.length == 1
    @etm = v.first
  else
    raise ArgumentError, "wrong number of arguments (#{v.length} for 1)"
  end
end

def mac_length(*v)
  @mac_length = nil if !defined?(@mac_length)
  if v.empty?
    @mac_length = superclass.mac_length if @mac_length.nil? && superclass.respond_to?(:mac_length)
    return @mac_length
  elsif v.length == 1
    @mac_length = v.first
  else
    raise ArgumentError, "wrong number of arguments (#{v.length} for 1)"
  end
end

def digest(data)
  OpenSSL::HMAC.digest(digest_class.new, key, data)[0,mac_length]
end

def digest_class(*v)
  @digest_class = nil if !defined?(@digest_class)
  if v.empty?
    @digest_class = superclass.digest_class if @digest_class.nil? && superclass.respond_to?(:digest_class)
    return @digest_class
  elsif v.length == 1
    @digest_class = v.first
  else
    raise ArgumentError, "wrong number of arguments (#{v.length} for 1)"
  end
end

def digest(data)
  ""
end

def send_message(message)
  socket.send_packet(message)
end

def peer
  @peer ||= { ip: socket.peer_ip, port: @port.to_i, host: @host, canonized: host_as_string }
end

def configure_client(options={})
  socket.client.set(options)
end

def configure_server(options={})
  socket.server.set(options)
end

def service_request(service)
  Net::SSH::Buffer.from(:byte, SERVICE_REQUEST, :string, service)
end

def hint(which, value=true)
  socket.hints[which] = value
end

def enqueue_message(message)
  socket.enqueue_packet(message)
end

def initialized?
  @initialized
end

def accept_kexinit(packet)
  info { "got KEXINIT from server" }
  @server_data = parse_server_algorithm_packet(packet)
  @server_packet = @server_data[:raw]
  if !pending?
    send_kexinit
  else
    proceed!
  end
end

def pending?
  @pending
end

def [](key)
  algorithms[key]
end

def allow?(packet)
  !pending? || Algorithms.allowed_packet?(packet)
end

def increment(packet_length)
  @sequence_number = (@sequence_number + 1) & 0xFFFFFFFF
  @packets += 1
  @blocks += (packet_length + 4) / @block_size
end

def reset!
  @packets = @blocks = 0

  @max_packets ||= 1 << 31

  @block_size = cipher.block_size

  if max_blocks.nil?
    # cargo-culted from openssh. the idea is that "the 2^(blocksize*2)
    # limit is too expensive for 3DES, blowfish, etc., so enforce a 1GB
    # limit for small blocksizes."
    if @block_size >= 16
      @max_blocks = 1 << (@block_size * 2)
    else
      @max_blocks = (1 << 30) / @block_size
    end

    # if a limit on the # of bytes has been given, convert that into a
    # minimum number of blocks processed.

    @max_blocks = [@max_blocks, rekey_limit / @block_size].min if rekey_limit
  end

  cleanup
end

def cleanup
  if @compressor
    @compressor.finish if !@compressor.finished?
    @compressor.close
  end

  if @decompressor
    # we call reset here so that we don't get warnings when we try to
    # close the decompressor
    @decompressor.reset
    @decompressor.close
  end

  @compressor = @decompressor = nil
end

def update(text)
  text
end

def iv=(v)
  nil
end

def iv=(iv_s)
  super unless @was_reset
end

def reset
  @was_reset = true
end

def search_for(host, options={})
  HostKeys.new(search_in(hostfiles(options), host, options), host, self, options)
end

def search_in(files, host, options = {})
  files.flat_map { |file| KnownHosts.new(file).keys_for(host, options) }
end

def match(host, pattern)
  if pattern.include?('*') || pattern.include?('?')
    # see man 8 sshd for pattern details
    pattern_regexp = pattern.split('*').map do |x|
      x.split('?').map do |y|
        Regexp.escape(y)
      end.join('.')
    end.join('[^.]*')

    host =~ Regexp.new("\\A#{pattern_regexp}\\z")
  else
    host == pattern
  end
end

def each(&block)
  @host_keys.each(&block)
end

def write_byte(*n)
  n.each { |b| @content << b.chr }
  self
end

def write_long(*n)
  @content << n.pack("N*")
  self
end

def write_moved(string)
  @content << string.force_encoding('BINARY')
  self
end

def write_bool(*b)
  b.each { |v| @content << (v ? "\1" : "\0") }
  self
end

def append(text)
  @content << text
  self
end

def length
  @content.length
end

def consume!(n=position)
  if n >= length
    # optimize for a fairly common case
    clear!
  elsif n > 0
    @content = @content[n..-1] || ""
    @position -= n
    @position = 0 if @position < 0
  end
  self
end

def clear!
  @content = ""
  @position = 0
end

def read(count=nil)
  count ||= length
  count = length - @position if @position + count > length
  @position += count
  @content[@position - count, count]
end

def write_key(*key)
  key.each { |k| append(k.to_blob) }
  self
end

def write(*data)
  data.each { |datum| @content << datum.dup.force_encoding('BINARY') }
  self
end

def write_bignum(*n)
  @content << n.map { |b| b.to_ssh }.join
  self
end

def empty?
  @content.empty?
end

def enqueue(data)
  output.append(data)
end

def fill(n=8192)
  input.consume!
  data = recv(n)
  debug { "read #{data.length} bytes" }
  input.append(data)
  return data.length
rescue EOFError => e
  @input_errors << e
  return 0
end

def read_available(length=nil)
  input.read(length || available)
end

def verify(arguments)
  return true if tunnelled?(arguments)
  super
end

def use_agent?
  @use_agent
end

def finish
  @agent.close if @agent
  @agent = nil
end

def send_message(msg)
  session.transport.send_message(msg)
end

def close
  @socket.close
end

def [](name)
  name = name.to_sym
  raise ArgumentError, "no such element #{name}" unless @named_elements.key?(name)
  @named_elements[name]
end

def register(session)
  @sessions << session
end

def process(wait = nil, &block)
  return false unless ev_preprocess(&block)

  ev_select_and_postprocess(wait)
end

def send_message(message)
  transport.enqueue_message(message)
end

def loop(wait=nil, &block)
  running = block || Proc.new { busy? }
  loop_forever { break unless process(wait, &running) }
  begin
    process(0)
  rescue IOError => e
    if e.message =~ /closed/
      debug { "stream was closed after loop => shallowing exception so it will be re-raised in next loop" }
    else
      raise
    end
  end
end

def process(wait=nil, &block)
  @event_loop.process(wait, &block)
rescue StandardError
  force_channel_cleanup_on_close if closed?
  raise
end

def ev_preprocess(&block)
  dispatch_incoming_packets(raise_disconnect_errors: false)
  each_channel { |id, channel| channel.process unless channel.local_closed? }
end

def ev_do_calculate_rw_wait(wait)
  r = listeners.keys
  w = r.select { |w2| w2.respond_to?(:pending_write?) && w2.pending_write? }
  [r,w,io_select_wait(wait)]
end

def max_select_wait_time
  @keepalive.interval if @keepalive.enabled?
end

def ev_do_postprocess(was_events)
  @keepalive.send_as_needed(was_events)
  transport.rekey_as_needed
  true
end

def cleanup_channel(channel)
  if channel.local_closed? and channel.remote_closed?
    info { "#{host} delete channel #{channel.local_id} which closed locally and remotely" }
    channels.delete(channel.local_id)
  end
end

def close
  info { "closing remaining channels (#{channels.length} open)" }
  channels.each { |id, channel| channel.close }
  begin
    loop(0.1) { channels.any? }
  rescue Net::SSH::Disconnect
    raise unless channels.empty?
  end
  transport.close
end

def wait
  connection.loop { active? }
end

def local_closed?
  @local_closed
end

def do_open_confirmation(remote_id, max_window, max_packet) #:nodoc:
  @remote_id = remote_id
  @remote_window_size = @remote_maximum_window_size = max_window
  @remote_maximum_packet_size = max_packet
  connection.forward.agent(self) if connection.options[:forward_agent] && type == "session"
  forward_local_env(connection.options[:send_env]) if connection.options[:send_env]
  set_remote_env(connection.options[:set_env]) if connection.options[:set_env]
  @on_confirm_open.call(self) if @on_confirm_open
end

def env(variable_name, variable_value, &block)
  send_channel_request("env", :string, variable_name, :string, variable_value, &block)
end

def exec(command, &block)
  send_channel_request("exec", :string, command, &block)
end

def do_window_adjust(bytes) #:nodoc:
  @remote_maximum_window_size += bytes
  @remote_window_size += bytes
end

def do_eof
  @on_eof.call(self) if @on_eof
end

def remote_closed!
  @remote_closed = true
end

def do_close
  @on_close.call(self) if @on_close
end

def remote_closed?
  @remote_closed
end

def [](name)
  @properties[name]
end

def []=(name, value)
  @properties[name] = value
end

def do_data(data) #:nodoc:
  update_local_window_size(data.length)
  @on_data.call(self, data) if @on_data
end

def do_extended_data(type, data)
  update_local_window_size(data.length)
  @on_extended_data.call(self, type, data) if @on_extended_data
end

def ev_preprocess(&block)
  return false if block_given? && !yield(@sessions.first)
  @sessions.each(&:ev_preprocess)
  return false if block_given? && !yield(@sessions.first)
  return true
end

def options
  @session.options
end

def send_as_needed(was_events)
  return if was_events
  return unless should_send?
  info { "sending keepalive #{@unresponded_keepalive_count}" }

  @unresponded_keepalive_count += 1
  @session.send_global_request("keepalive@openssh.com") { |success, response|
    debug { "keepalive response successful. Missed #{@unresponded_keepalive_count - 1} keepalives" }
    @unresponded_keepalive_count = 0
  }
  @last_keepalive_sent_at = Time.now
  if keepalive_maxcount > 0 && @unresponded_keepalive_count > keepalive_maxcount
    error { "Timeout, server #{@session.host} not responding. Missed #{@unresponded_keepalive_count - 1} timeouts." }
    @unresponded_keepalive_count = 0
    raise Net::SSH::Timeout, "Timeout, server #{@session.host} not responding."
  end
end

def to_blob
  @blob ||= Net::SSH::Buffer.from(:string, ssh_type,
                                  :string, CurveNameAliasInv[group.curve_name],
                                  :mstring, public_key.to_bn.to_s(2)).to_s
  @blob
end

def to_blob
  @blob ||= Net::SSH::Buffer.from(:string, ssh_type, :bignum, e, :bignum, n).to_s
end
